import React from "react";
import { Container, Text, SubHeader } from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  /* align-items: center; */
  flex: 0.65;
  padding-top:50px;
  padding-left:60px;
  padding-right:10px;
  /* justify-content: center; */
  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
  /* @media ${device.laptopL} {
    flex: 0.65;
  } */
`;
const FormWrapper = styled(Container)`
  flex-direction: row;

  flex: 0.35;
  justify-content: center;
  min-height: 100%;
  max-height: 100%;
  /* @media ${device.laptopL} {
  } */
`;
const Form = styled.form`
  display: flex;
`;

const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <ImgWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text customStyles={{ color: "white" }}>House-Assist Space</Text>
        </Container>
      </ImgWrapper>
      <FormWrapper>
        <form></form>
        <Text>forms</Text>
      </FormWrapper>
    </Container>
  );
};

export default Login;
